      .coelsa__header {
        width: 220px;

      }

      .ip-no-informada__container{
        display:flex;
        justify-content: space-around;
        align-items: center;
      }

      .ip-no-informada__description {
        max-width: 60vw;
      }

      .ip-no-informada__title--no-margin {
        margin: 0;
         font-size: clamp(1.6rem, 4vw + 1.03rem, 2.8rem);
        color: #fff7ff;
      }

      .ip-no-informada__title {
        margin: 0;
        font-size: clamp(1.6rem, 4vw + 1.03rem, 2.8rem);
        color: #fff7ff;
        padding-bottom: 10px;
      }

      .ip-no-informada__text {
        margin:  0;
        font-size: clamp(1rem, 2vw + 0.5rem, 1.5rem);
        color: #fff7ff;
      }

      .ip-no-informada__description--email {
        text-decoration: underline;
      }

      .ip-no-informada__link {
        margin-top: 30px;
        display: inline-block;
        background: #bb2f82;
        border: 1px solid #bb2f82;
        border-radius: 20px;
        padding: 6px 12px;
        box-shadow: 0 3px 2px -2px #fff7ff;
        color: #fff7ff;
        text-decoration: none;
        font-size: 1rem;
      }

      @media screen and (max-width: 950px) {
        .ip-no-informada__container {
          flex-direction: column-reverse;
          justify-content: center;
          align-items: center;
          margin: 0 2vw;
        }
      
        .ip-no-informada__image svg{
          position: fixed;
          top: 20px;
          right: 20px;
          width: 80px;
          height: 80px;
        }

      .ip-no-informada__description {
        max-width: 85vw;
      }

       @media screen and (max-width: 550px) {

          position: fixed;
          top: 40px;
          right: 30px;
          width: 50px;
          height: 50px;
        }

        max-width: 100vw;
      }
